@pytest.mark.slow
class TestArbiscanArbitrumApiCalls(TestCase):
    api = ArbiscanArbitrumApi.get_instance()

    addresses = ['0x73EbF040cb59F60c6bf7a43A44D092710bef621A',
                 '0x7Ade75Da6940929482E986FBb08b6Cd02fCE96E9']

    contract_info = {
        'address': '0xfd086bc7cd5c481dcc9c85ebe478a1c0b69fcbb9',
        'decimals': 6,
        'symbol': 'USDT'
    }

    @classmethod
    def check_general_response(cls, response):
        if set(response.keys()) != {'status', 'message', 'result'}:
            return False
        return True

    def test_get_balance_api(self):
        for address in self.addresses:
            get_balance_result = self.api.get_balance(address)
            assert self.check_general_response(get_balance_result)
            assert isinstance(get_balance_result.get('result'), str)

    def test_get_token_balance_api(self):
        for address in self.addresses:
            get_token_balance_result = self.api.get_token_balance(address, self.contract_info)
            assert self.check_general_response(get_token_balance_result)
            assert isinstance(get_token_balance_result.get('result'), str)

    def test_get_address_txs_api(self):
        for address in self.addresses:
            get_address_txs_response = self.api.get_address_txs(address)
            assert self.check_general_response(get_address_txs_response)
            assert len(get_address_txs_response.get('result')) > 0
            for transaction in get_address_txs_response.get('result'):
                assert {'isError', 'methodId', 'functionName', 'value', 'from', 'to', 'confirmations', 'hash',
                        'blockNumber', 'timeStamp'}.issubset(set(transaction.keys()))


class TestArbiscanArbitrumFromExplorer(TestCase):
    api = ArbiscanArbitrumApi

    addresses = ['0x73EbF040cb59F60c6bf7a43A44D092710bef621A',
                 '0x7Ade75Da6940929482E986FBb08b6Cd02fCE96E9']

    addresses_for_usdt = ['0x5bdf85216ec1e38d6458c870992a69e38e03f7ef']

    def test_get_balance(self):
        balance_mock_responses = [{'status': '1', 'message': 'OK', 'result': '20698800000000'},
                                  {'status': '1', 'message': 'OK', 'result': '2574193168345789'}]
        self.api.get_balance = Mock(side_effect=balance_mock_responses)
        ArbitrumExplorerInterface.balance_apis[0] = self.api
        balances = BlockchainExplorer.get_wallets_balance({'ARB': self.addresses}, Currencies.eth)
        expected_balances = [{'address': '0x73EbF040cb59F60c6bf7a43A44D092710bef621A', 'balance': Decimal('0.000020698800000000'), 'received': Decimal('0.000020698800000000'), 'sent': Decimal('0'), 'rewarded': Decimal('0')},
                             {'address': '0x7Ade75Da6940929482E986FBb08b6Cd02fCE96E9', 'balance': Decimal('0.002574193168345789'), 'received': Decimal('0.002574193168345789'), 'sent': Decimal('0'), 'rewarded': Decimal('0')}]
        for balance, expected_balance in zip(balances.get(Currencies.eth), expected_balances):
            assert balance == expected_balance

    def test_get_token_balance(self):
        token_balance_mock_responses = [{'status': '1', 'message': 'OK', 'result': '566115876569'}]
        self.api.get_token_balance = Mock(side_effect=token_balance_mock_responses)
        ArbitrumExplorerInterface.token_balance_apis[0] = self.api
        token_balances = BlockchainExplorer.get_wallets_balance({'ARB': self.addresses_for_usdt}, Currencies.usdt)
        expected_token_balances = [{'address': '0x5bdf85216ec1e38d6458c870992a69e38e03f7ef', 'balance': Decimal('566115.876569'), 'received': Decimal('566115.876569'), 'sent': Decimal('0'), 'rewarded': Decimal('0')}]
        for token_balance, expected_token_balance in zip(token_balances.get(Currencies.usdt), expected_token_balances):
            assert token_balance == expected_token_balance

